import React from 'react';
import { Container} from 'react-bootstrap';

const Dashboard = () => {
  return (
    <Container className="mt-5">
        <h1>Welcome to the Dashboard!</h1>
        <p>This is a general dashboard for all users.</p>
    </Container>
  );
};

export default Dashboard;
